import React, { Component } from "react";
import { Col, Row, Container } from "../components/Grid";
import Form from "../components/Form";

class Main extends Component {
render() {
return (

<Container fluid>
    <Row>
        <Col size="md-6">
<Form></Form>
        </Col>
    </Row>
</Container>

)
}
}

export default Main;
